  false,\n\t\"url\": null,\n\t\"notes\": \"The raster-based, color-infrared composite
  was derived from Landsat Thematic Mapper imagery data acquired during June 1989
  for the Sarcobatus Flat area of the Death Valley regional flow system. The image
  is a single-channel, parallelepiped classification that when displayed using a 256-color
  color table shows a simulation of a color-infrared composite. The data set was used
  in determining phreatophyte boundaries for a ground-water evapotranspiration study.\",\n\t\"owner_org\":
